  [],\n\t\"revision_timestamp\": \"2016-08-04T08:16:50.982523\",\n\t\"name\": \"refuge-narrative-report-september-december-1961-kenai-national-moose-range\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai NWR outlines
  Refuge accomplishments from September through December of 1961. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, big game
  animals, furbearers, predators, rodents, mammals, raptors, fish, and disease- is
  also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, and wildfires. Resource management
  is outlined; topics include fur harvesting, timber removal, and commercial fishing.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, violations, and safety. Items of interest and N-R
  forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
